import React, { Component } from "react";
import "./weather.css";

export default class weather extends Component {
  render() {
    return (
      <div>
        <h1>Weather App</h1>
        <form className="form">
          <input type="text" placeholder="Pune" className="input" />
          <button type="submit" className="button">
            Get Weather
          </button>
        </form>
      </div>
    );
  }
}
